import React, {useState, useEffect} from 'react';
import '../css/ImageThumbnail.css';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function PostThumbnail(props) {

    const viewPost = () => {
        navigate(`/s/${props.postObject.serverId}`);
    }

    return(
        <div className="col">
            <div className="grid-item border border-secondary" onClick={viewPost}>
                <img className="image-thumbnail" src={`http://localhost:5000/files/image/${props.postObject.dataId}`}/>
            </div>
        </div>
    )
}

export default PostThumbnail;
